import "./it.css";
import Stock from "./Stock";
import Product from "./product";
import { Routes, Route } from "react-router-dom";

export default function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Stock />} />
        <Route exact path="/products/:id" element={<Product />} />
      </Routes>
    </div>
  );
}
